import React from 'react';
import logo from '../Images/logo.svg';
import s from './HedNav.module.css';

export default class HedNav extends React.Component {
  state = {
    bars: false,
  };

  Done = () => {
    this.setState(({ bars }) => {
      return {
        bars: !bars,
      };
    });
  };
  render() {
    const { bars } = this.state;
    return (
      <div className='item'>
        <nav>
          <img src={logo} />
          <ul className='itemUl'>
            <li>
              <a>Product</a>
            </li>
            <li>
              <a>Features</a>
            </li>
            <li>
              <a>Testimonial</a>
            </li>
            <li>
              <a>FAQ</a>
            </li>
            <li>
              <a>Pricing</a>
            </li>
            <li>
              <a>Contact Us</a>
            </li>
          </ul>
          <div className='icon'>
            <b>
              <p onClick={this.Done}>
                {' '}
                <i class='fas fa-bars'></i>
              </p>
            </b>
          </div>
          <ul className={`itemUl2 ${bars ? 'itemUl22' : ''}`}>
            <li>
              <a>Product</a>
            </li>
            <li>
              <a>Features</a>
            </li>
            <li>
              <a>Testimonial</a>
            </li>
            <li>
              <a>FAQ</a>
            </li>
            <li>
              <a>Pricing</a>
            </li>
            <li>
              <a>Contact Us</a>
            </li>
          </ul>
        </nav>
      </div>
    );
  }
}
